@SaintHeron honors the legacy and archives of Womack & Womack with a dossier exhibition including a gallery of unpublished photos and home videos, and the family's inspiring journey raising  seven children living across multiple countries and continents (Johannesburg, Bangkok, Dublin, Bali, Sydney, France) and their spiritually, culturally and musically-rooted family structure in a moving, true account penned by penned by award-winning author of “Black is the Body,” Emily Bernard told by the Womack’s three daughters Zekuumba (BG), Zeimani, and Kucha (KC) Zekkariyas.

I feel so so honored for the trust in @SaintHeron to bring this archive to life and so beyond inspired and proud of it being in the world.

Experience the exhibition on WWW.SAINTHERON.COM (link in bio:)
